class Solution {
    /**
     * Separates groups of nested parentheses into separate strings.
     * Each group is balanced and not nested within each other.
     * Spaces in the input string are ignored.
     *
     * @param paren_string The input string containing groups of nested parentheses.
     * @return A list of separated groups of nested parentheses.
     */
    public List<String> separate_paren_groups(String paren_string) {
        List<String> result = new ArrayList<>();
        StringBuilder currentGroup = new StringBuilder();
        int balance = 0;

        for (char c : paren_string.replaceAll("\\s+", "").toCharArray()) {
            if (c == '(') {
                balance++;
            } else if (c == ')') {
                balance--;
            }
            currentGroup.append(c);

            if (balance == 0 && currentGroup.length() > 0) {
                result.add(currentGroup.toString());
                currentGroup.setLength(0); // Clear the StringBuilder
            }
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        String test1 = "( ) (( )) (( )( ))";
        String test2 = "((())) (()) ()";
        String test3 = "(()(()))";

        System.out.println("Test 1: " + solution.separate_paren_groups(test1));
        System.out.println("Test 2: " + solution.separate_paren_groups(test2));
        System.out.println("Test 3: " + solution.separate_paren_groups(test3));
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

