class Solution {
    /**
     * Converts a list of numerical GPAs to their corresponding letter grades.
     *
     * @param grades A list of GPAs (double values).
     * @return A list of letter grades (String values).
     */
    public List<String> numerical_letter_grade(List<Double> grades) {
        List<String> letterGrades = new ArrayList<>();
        for (Double gpa : grades) {
            if (gpa == 4.0) {
                letterGrades.add("A+");
            } else if (gpa > 3.7) {
                letterGrades.add("A");
            } else if (gpa > 3.3) {
                letterGrades.add("A-");
            } else if (gpa > 3.0) {
                letterGrades.add("B+");
            } else if (gpa > 2.7) {
                letterGrades.add("B");
            } else if (gpa > 2.3) {
                letterGrades.add("B-");
            } else if (gpa > 2.0) {
                letterGrades.add("C+");
            } else if (gpa > 1.7) {
                letterGrades.add("C");
            } else if (gpa > 1.3) {
                letterGrades.add("C-");
            } else if (gpa > 1.0) {
                letterGrades.add("D+");
            } else if (gpa > 0.7) {
                letterGrades.add("D");
            } else if (gpa > 0.0) {
                letterGrades.add("D-");
            } else {
                letterGrades.add("E");
            }
        }
        return letterGrades;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Double> grades1 = Arrays.asList(4.0, 3.0, 1.7, 2.0, 3.5);
        List<String> expected1 = Arrays.asList("A+", "B", "C-", "C", "A-");
        System.out.println("Test Case 1: " + (solution.numerical_letter_grade(grades1).equals(expected1) ? "Passed" : "Failed"));

        List<Double> grades2 = Arrays.asList(3.8, 2.5, 1.2, 0.5, 4.0);
        List<String> expected2 = Arrays.asList("A", "B-", "D+", "D-", "A+");
        System.out.println("Test Case 2: " + (solution.numerical_letter_grade(grades2).equals(expected2) ? "Passed" : "Failed"));

        List<Double> grades3 = Arrays.asList(3.4, 2.8, 1.6, 0.8, 0.0);
        List<String> expected3 = Arrays.asList("A-", "B", "C", "D", "E");
        System.out.println("Test Case 3: " + (solution.numerical_letter_grade(grades3).equals(expected3) ? "Passed" : "Failed"));
    }
}

