class Solution {
    /**
     * Given a list of numbers, return whether or not they are sorted
     * in ascending order. If a number appears more than twice, return false. Assume no negative numbers and only integers.
     *
     * @param lst List of integers to check
     * @return true if the list is sorted in ascending order and no number appears more than twice, false otherwise
     */
    public boolean is_sorted(List<Integer> lst) {
        if (lst == null || lst.size() <= 1) {
            return true;
        }

        Map<Integer, Integer> countMap = new HashMap<>();
        for (int i = 0; i < lst.size() - 1; i++) {
            int current = lst.get(i);
            int next = lst.get(i + 1);

            // Check if the list is sorted in ascending order
            if (current > next) {
                return false;
            }

            // Count occurrences of each number
            countMap.put(current, countMap.getOrDefault(current, 0) + 1);
            if (i == lst.size() - 2) {
                countMap.put(next, countMap.getOrDefault(next, 0) + 1);
            }
        }

        // Check if any number appears more than twice
        for (int count : countMap.values()) {
            if (count > 2) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.is_sorted(Arrays.asList(5))); // true
        System.out.println(solution.is_sorted(Arrays.asList(1, 2, 3, 4, 5))); // true
        System.out.println(solution.is_sorted(Arrays.asList(1, 3, 2, 4, 5))); // false
        System.out.println(solution.is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6))); // true
        System.out.println(solution.is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6, 7))); // true
        System.out.println(solution.is_sorted(Arrays.asList(1, 3, 2, 4, 5, 6, 7))); // false
        System.out.println(solution.is_sorted(Arrays.asList(1, 2, 2, 3, 3, 4))); // true
        System.out.println(solution.is_sorted(Arrays.asList(1, 2, 2, 2, 3, 4))); // false
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.is_sorted(new ArrayList<>(List.of(5))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 3, 2, 4, 5))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5, 6))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5, 6, 7))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 3, 2, 4, 5, 6, 7))) == false,
                s.is_sorted(new ArrayList<>(List.of())) == true,
                s.is_sorted(new ArrayList<>(List.of(1))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(3, 2, 1))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 2, 2, 3, 4))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 3, 3, 4))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 2, 3, 3, 4))) == true,
