class Solution {
    private static final int[][] DIRECTIONS = {{0, 1}, {1, 0}, {0, -1}, {-1, 0}};

    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        PriorityQueue<Path> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < Math.min(a.path.size(), b.path.size()); i++) {
                if (!a.path.get(i).equals(b.path.get(i))) {
                    return a.path.get(i) - b.path.get(i);
                }
            }
            return a.path.size() - b.path.size();
        });

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                pq.offer(new Path(new ArrayList<>(List.of(grid.get(i).get(j))), i, j));
            }
        }

        while (!pq.isEmpty()) {
            Path current = pq.poll();
            if (current.path.size() == k) {
                return current.path;
            }
            for (int[] dir : DIRECTIONS) {
                int ni = current.i + dir[0];
                int nj = current.j + dir[1];
                if (ni >= 0 && ni < n && nj >= 0 && nj < n) {
                    List<Integer> newPath = new ArrayList<>(current.path);
                    newPath.add(grid.get(ni).get(nj));
                    pq.offer(new Path(newPath, ni, nj));
                }
            }
        }

        return new ArrayList<>();
    }

    private static class Path {
        List<Integer> path;
        int i, j;

        Path(List<Integer> path, int i, int j) {
            this.path = path;
            this.i = i;
            this.j = j;
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<List<Integer>> grid1 = Arrays.asList(
            Arrays.asList(1, 2, 3),
            Arrays.asList(4, 5, 6),
            Arrays.asList(7, 8, 9)
        );
        int k1 = 3;
        System.out.println(solution.minPath(grid1, k1)); // Output: [1, 2, 1]

        // Test case 2
        List<List<Integer>> grid2 = Arrays.asList(
            Arrays.asList(5, 9, 3),
            Arrays.asList(4, 1, 6),
            Arrays.asList(7, 8, 2)
        );
        int k2 = 1;
        System.out.println(solution.minPath(grid2, k2)); // Output: [1]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.minPath(Arrays.asList(Arrays.asList(1, 2, 3), Arrays.asList(4, 5, 6), Arrays.asList(7, 8, 9)), 3).equals(Arrays.asList(1, 2, 1)),
