class Solution {
    /**
     * Find how many times a given substring can be found in the original string. Count overlapping cases.
     * 
     * @param string The original string.
     * @param substring The substring to find.
     * @return The number of times the substring appears in the original string, including overlaps.
     */
    public int how_many_times(String string, String substring) {
        if (substring.isEmpty() || string.length() < substring.length()) {
            return 0;
        }

        int count = 0;
        int index = 0;

        while ((index = string.indexOf(substring, index)) != -1) {
            count++;
            index++; // Move to the next character to allow for overlapping matches
        }

        return count;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.how_many_times("", "a")); // Expected output: 0
        System.out.println(solution.how_many_times("aaa", "a")); // Expected output: 3
        System.out.println(solution.how_many_times("aaaa", "aa")); // Expected output: 3
        System.out.println(solution.how_many_times("abababa", "aba")); // Expected output: 3
        System.out.println(solution.how_many_times("testtest", "test")); // Expected output: 2
    }
}

