class Solution {
    /**
     * Return median of elements in the list l.
     * 
     * @param l the list of integers
     * @return the median value
     */
    public double median(List<Integer> l) {
        if (l == null || l.isEmpty()) {
            throw new IllegalArgumentException("List must not be null or empty");
        }

        List<Integer> sortedList = new ArrayList<>(l);
        Collections.sort(sortedList);

        int size = sortedList.size();
        if (size % 2 == 1) {
            return sortedList.get(size / 2);
        } else {
            return (sortedList.get(size / 2 - 1) + sortedList.get(size / 2)) / 2.0;
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Integer> test1 = Arrays.asList(3, 1, 2, 4, 5);
        List<Integer> test2 = Arrays.asList(-10, 4, 6, 1000, 10, 20);

        System.out.println("Median of " + test1 + " is: " + solution.median(test1)); // Expected: 3
        System.out.println("Median of " + test2 + " is: " + solution.median(test2)); // Expected: 8.0
    }
}

