class Solution {
    /**
    Your task is to write a function that returns true if a number x is a simple
    power of n and false in other cases.
    x is a simple power of n if n**int=x
    For example:
    is_simple_power(1, 4) => true
    is_simple_power(2, 2) => true
    is_simple_power(8, 2) => true
    is_simple_power(3, 2) => false
    is_simple_power(3, 1) => false
    is_simple_power(5, 3) => false
     */
    public boolean is_simple_power(int x, int n) {
        if (n == 1) {
            return x == 1;
        }
        if (x <= 0 || n <= 0) {
            return false;
        }
        double logResult = Math.log(x) / Math.log(n);
        return Math.abs(logResult - Math.round(logResult)) < 1e-10;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.is_simple_power(1, 4)); // true
        System.out.println(solution.is_simple_power(2, 2)); // true
        System.out.println(solution.is_simple_power(8, 2)); // true
        System.out.println(solution.is_simple_power(3, 2)); // false
        System.out.println(solution.is_simple_power(3, 1)); // false
        System.out.println(solution.is_simple_power(5, 3)); // false
        System.out.println(solution.is_simple_power(16, 2)); // true
        System.out.println(solution.is_simple_power(27, 3)); // true
        System.out.println(solution.is_simple_power(1, 1)); // true
        System.out.println(solution.is_simple_power(0, 2)); // false
        System.out.println(solution.is_simple_power(-1, 2)); // false
        System.out.println(solution.is_simple_power(2, -2)); // false
    }
}

