     */
    public List<String> total_match(List<String> lst1, List<String> lst2) {
        int count1 = lst1.stream().mapToInt(String::length).sum();
        int count2 = lst2.stream().mapToInt(String::length).sum();

        if (count1 <= count2) {
            return lst1;
        } else {
            return lst2;
        }
    }

