class Solution {
    /**
     * Given two positive integers a and b, return the even digits between a
     * and b, in ascending order. Please note that the even digits refer to even numbers less than 10.
     *
     * @param a the first integer
     * @param b the second integer
     * @return a list of even digits between a and b in ascending order
     */
    public List<Integer> generate_integers(int a, int b) {
        // Ensure a is always less than or equal to b
        if (a > b) {
            int temp = a;
            a = b;
            b = temp;
        }

        List<Integer> result = new ArrayList<>();
        for (int i = Math.max(a, 0); i <= Math.min(b, 9); i++) {
            if (i % 2 == 0) {
                result.add(i);
            }
        }
        return result;
    }

