class Solution {
    /**
    You are given a string representing a sentence,
    the sentence contains some words separated by a space,
    and you have to return a string that contains the words from the original sentence,
    whose lengths are prime numbers,
    the order of the words in the new string should be the same as the original one.

    Example 1:
        Input: sentence = "This is a test"
        Output: "is"

    Example 2:
        Input: sentence = "lets go for swimming"
        Output: "go for"

    Constraints:
        * 1 <= len(sentence) <= 100
        * sentence contains only letters
     */
    public String words_in_sentence(String sentence) {
        // Split the sentence into words
        String[] words = sentence.split(" ");
        StringBuilder result = new StringBuilder();

        for (String word : words) {
            if (isPrime(word.length())) {
                if (result.length() > 0) {
                    result.append(" ");
                }
                result.append(word);
            }
        }

        return result.toString();
    }

    // Helper method to check if a number is prime
    private boolean isPrime(int n) {
        if (n <= 1) return false;
        if (n <= 3) return true;
        if (n % 2 == 0 || n % 3 == 0) return false;
        for (int i = 5; i * i <= n; i += 6) {
            if (n % i == 0 || n % (i + 2) == 0) return false;
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        String test1 = "This is a test";
        String expected1 = "is";
        System.out.println("Test 1: " + (solution.words_in_sentence(test1).equals(expected1) ? "Passed" : "Failed"));

        String test2 = "lets go for swimming";
        String expected2 = "go for";
        System.out.println("Test 2: " + (solution.words_in_sentence(test2).equals(expected2) ? "Passed" : "Failed"));

        String test3 = "I love programming";
        String expected3 = "I";
        System.out.println("Test 3: " + (solution.words_in_sentence(test3).equals(expected3) ? "Passed" : "Failed"));

        String test4 = "Java is fun";
        String expected4 = "is";
        System.out.println("Test 4: " + (solution.words_in_sentence(test4).equals(expected4) ? "Passed" : "Failed"));
    }
}

