class Solution {
    private static final List<String> PLANETS = Arrays.asList(
        "Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"
    );

    /**
     * Returns a list of planets whose orbits are located between the orbit of planet1 and the orbit of planet2.
     * @param planet1 The name of the first planet.
     * @param planet2 The name of the second planet.
     * @return A list of planets between planet1 and planet2, sorted by proximity to the sun.
     */
    public List<String> bf(String planet1, String planet2) {
        if (!PLANETS.contains(planet1) || !PLANETS.contains(planet2)) {
            return Collections.emptyList();
        }

        int index1 = PLANETS.indexOf(planet1);
        int index2 = PLANETS.indexOf(planet2);

        if (index1 > index2) {
            // Ensure index1 is always less than index2
            int temp = index1;
            index1 = index2;
            index2 = temp;
        }

        List<String> result = new ArrayList<>();
        for (int i = index1 + 1; i < index2; i++) {
            result.add(PLANETS.get(i));
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.bf("Jupiter", "Neptune")); // ["Saturn", "Uranus"]
        System.out.println(solution.bf("Earth", "Mercury"));   // ["Venus"]
        System.out.println(solution.bf("Mercury", "Uranus")); // ["Venus", "Earth", "Mars", "Jupiter", "Saturn"]
        System.out.println(solution.bf("Pluto", "Mars"));      // []
        System.out.println(solution.bf("Saturn", "Venus"));    // ["Earth", "Mars", "Jupiter"]
    }
}

