    public String get_closest_vowel(String word) {
        Set<Character> vowels = new HashSet<>(Arrays.asList('a', 'e', 'i', 'o', 'u', 'A', 'E', 'I', 'O', 'U'));

        for (int i = word.length() - 2; i > 0; i--) {
            char currentChar = word.charAt(i);
            char prevChar = word.charAt(i - 1);
            char nextChar = word.charAt(i + 1);

            if (vowels.contains(currentChar) && !vowels.contains(prevChar) && !vowels.contains(nextChar)) {
                return String.valueOf(currentChar);
            }
        }

        return "";
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.get_closest_vowel("yogurt")); // Expected: "u"
        System.out.println(solution.get_closest_vowel("FULL"));   // Expected: "U"
        System.out.println(solution.get_closest_vowel("quick"));  // Expected: ""
        System.out.println(solution.get_closest_vowel("ab"));     // Expected: ""
        System.out.println(solution.get_closest_vowel("rhythm")); // Expected: ""
        System.out.println(solution.get_closest_vowel("AeIoU"));  // Expected: ""
        System.out.println(solution.get_closest_vowel("bAc"));    // Expected: "A"
    }
}

