class Solution {
    /**
     * Simplifies the expression x * n and returns true if the result is a whole number, false otherwise.
     * Both x and n are string representations of fractions in the format <numerator>/<denominator>.
     *
     * @param x The first fraction as a string.
     * @param n The second fraction as a string.
     * @return true if x * n evaluates to a whole number, false otherwise.
     */
    public boolean simplify(String x, String n) {
        // Split the fractions into numerator and denominator
        String[] xParts = x.split("/");
        String[] nParts = n.split("/");

        // Parse the numerators and denominators
        int xNumerator = Integer.parseInt(xParts[0]);
        int xDenominator = Integer.parseInt(xParts[1]);
        int nNumerator = Integer.parseInt(nParts[0]);
        int nDenominator = Integer.parseInt(nParts[1]);

        // Calculate the product of the fractions
        int productNumerator = xNumerator * nNumerator;
        int productDenominator = xDenominator * nDenominator;

        // Check if the product is a whole number
        return productNumerator % productDenominator == 0;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.simplify("1/5", "5/1")); // true
        System.out.println(solution.simplify("1/6", "2/1")); // false
        System.out.println(solution.simplify("7/10", "10/2")); // false
        System.out.println(solution.simplify("3/4", "4/3")); // true
        System.out.println(solution.simplify("2/3", "3/2")); // true
    }
}

