class Solution {
    /**
     * Finds the word with the maximum number of unique characters.
     * If multiple words have the same maximum number of unique characters,
     * returns the one that comes first in lexicographical order.
     *
     * @param words List of strings to be evaluated.
     * @return The word with the maximum number of unique characters.
     */
    public String find_max(List<String> words) {
        if (words == null || words.isEmpty()) {
            return "";
        }

        String maxWord = "";
        int maxUniqueCount = 0;

        for (String word : words) {
            Set<Character> uniqueChars = new HashSet<>();
            for (char c : word.toCharArray()) {
                uniqueChars.add(c);
            }

            int uniqueCount = uniqueChars.size();
            if (uniqueCount > maxUniqueCount || (uniqueCount == maxUniqueCount && word.compareTo(maxWord) < 0)) {
                maxUniqueCount = uniqueCount;
                maxWord = word;
            }
        }

        return maxWord;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<String> test1 = Arrays.asList("name", "of", "string");
        System.out.println(solution.find_max(test1)); // Output: "string"

        List<String> test2 = Arrays.asList("name", "enam", "game");
        System.out.println(solution.find_max(test2)); // Output: "enam"

        List<String> test3 = Arrays.asList("aaaaaaa", "bb", "cc");
        System.out.println(solution.find_max(test3)); // Output: "aaaaaaa"

        List<String> test4 = Arrays.asList("apple", "banana", "cherry");
        System.out.println(solution.find_max(test4)); // Output: "banana"

        List<String> test5 = Arrays.asList("a", "b", "c");
        System.out.println(solution.find_max(test5)); // Output: "a"
    }
}

