class Solution {
    /**
     * This function takes a list l and returns a list l' such that
     * l' is identical to l in the odd indices, while its values at the even indices are equal
     * to the values of the even indices of l, but sorted.
     * 
     * Examples:
     * >>> sort_even(Arrays.asList(1, 2, 3))
     * [1, 2, 3]
     * >>> sort_even(Arrays.asList(5, 6, 3, 4))
     * [3, 6, 5, 4]
     */
    public List<Integer> sort_even(List<Integer> l) {
        List<Integer> evenIndicesValues = new ArrayList<>();

        // Collect values at even indices
        for (int i = 0; i < l.size(); i += 2) {
            evenIndicesValues.add(l.get(i));
        }

        // Sort the collected values
        Collections.sort(evenIndicesValues);

        // Create the result list
        List<Integer> result = new ArrayList<>(l.size());
        int evenIndex = 0;

        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
                result.add(evenIndicesValues.get(evenIndex++));
            } else {
                result.add(l.get(i));
            }
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Integer> test1 = Arrays.asList(1, 2, 3);
        List<Integer> test2 = Arrays.asList(5, 6, 3, 4);
        List<Integer> test3 = Arrays.asList(7, 8, 9, 10, 11, 12);
        List<Integer> test4 = Arrays.asList(4, 1, 2, 3);

        System.out.println("Test 1: " + solution.sort_even(test1)); // Expected: [1, 2, 3]
        System.out.println("Test 2: " + solution.sort_even(test2)); // Expected: [3, 6, 5, 4]
        System.out.println("Test 3: " + solution.sort_even(test3)); // Expected: [7, 8, 9, 10, 11, 12]
        System.out.println("Test 4: " + solution.sort_even(test4)); // Expected: [2, 1, 4, 3]
    }
}

