class Solution {
    /**
     * Create a function that takes integers, floats, or strings representing
     * real numbers, and returns the larger variable in its given variable type.
     * Return None if the values are equal.
     * Note: If a real number is represented as a string, the floating point might be . or ,
     *
     * @param a First value to compare
     * @param b Second value to compare
     * @return The larger value wrapped in an Optional, or Optional.empty() if they are equal
     */
    public Optional<Object> compare_one(Object a, Object b) {
        double valA = convertToDouble(a);
        double valB = convertToDouble(b);

        if (valA == valB) {
            return Optional.empty();
        } else if (valA > valB) {
            return Optional.of(a);
        } else {
            return Optional.of(b);
        }
    }

    private double convertToDouble(Object obj) {
        if (obj instanceof String) {
            String str = (String) obj;
            str = str.replace(',', '.');
            return Double.parseDouble(str);
        } else if (obj instanceof Integer) {
            return ((Integer) obj).doubleValue();
        } else if (obj instanceof Double) {
            return (Double) obj;
        } else {
            throw new IllegalArgumentException("Unsupported type: " + obj.getClass().getName());
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.compare_one(1, 2.5)); // Expected: Optional[2.5]
        System.out.println(solution.compare_one(1, "2,3")); // Expected: Optional[2,3]
        System.out.println(solution.compare_one("5,1", "6")); // Expected: Optional[6]
        System.out.println(solution.compare_one("1", 1)); // Expected: Optional.empty
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                (int) s.compare_one(1, 2).get() == 2,
                (double) s.compare_one(1, 2.5).get() == 2.5,
                (int) s.compare_one(2, 3).get() == 3,
                (int) s.compare_one(5, 6).get() == 6,
                (String) s.compare_one(1, "2,3").get() == "2,3",
                (String) s.compare_one("5,1", "6").get() == "6",
                (String) s.compare_one("1", "2").get() == "2",
                s.compare_one("1", 1).isEmpty()
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

