class Solution {
    /**
     * Change numerical base of input number x to base.
     * Return string representation after the conversion.
     * Base numbers are less than 10.
     * 
     * @param x the number to convert
     * @param base the new base (less than 10)
     * @return the string representation of the number in the new base
     */
    public String change_base(int x, int base) {
        if (base < 2 || base > 9) {
            throw new IllegalArgumentException("Base must be between 2 and 9");
        }

        StringBuilder result = new StringBuilder();
        while (x > 0) {
            result.insert(0, x % base);
            x /= base;
        }

        return result.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.change_base(8, 3));  // Expected output: "22"
        System.out.println(solution.change_base(8, 2));  // Expected output: "1000"
        System.out.println(solution.change_base(7, 2));  // Expected output: "111"
        System.out.println(solution.change_base(15, 4)); // Expected output: "33"
        System.out.println(solution.change_base(25, 5)); // Expected output: "100"
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.change_base(8, 3), "22"),
