class Solution {
    /**
     * Task
     * We are given two strings s and c, you have to delete all the characters in s that are equal to any character in c
     * then check if the result string is palindrome.
     * A string is called palindrome if it reads the same backward as forward.
     * You should return a tuple containing the result string and true/false for the check.
     * 
     * Example
     * For s = "abcde", c = "ae", the result should be ("bcd", false)
     * For s = "abcdef", c = "b"  the result should be ("acdef", false)
     * For s = "abcdedcba", c = "ab", the result should be ("cdedc", true)
     */
    public List<Object> reverse_delete(String s, String c) {
        StringBuilder result = new StringBuilder();

        // Create a set of characters to delete
        Set<Character> charsToDelete = new HashSet<>();
        for (char ch : c.toCharArray()) {
            charsToDelete.add(ch);
        }

        // Build the result string by excluding characters in charsToDelete
        for (char ch : s.toCharArray()) {
            if (!charsToDelete.contains(ch)) {
                result.append(ch);
            }
        }

        // Check if the result string is a palindrome
        String resultStr = result.toString();
        String reversedStr = result.reverse().toString();
        boolean isPalindrome = resultStr.equals(reversedStr);

        return Arrays.asList(resultStr, isPalindrome);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.reverse_delete("abcde", "ae")); // Expected: [bcd, false]
        System.out.println(solution.reverse_delete("abcdef", "b")); // Expected: [acdef, false]
        System.out.println(solution.reverse_delete("abcdedcba", "ab")); // Expected: [cdedc, true]
        System.out.println(solution.reverse_delete("radar", "r")); // Expected: [ada, true]
        System.out.println(solution.reverse_delete("hello", "l")); // Expected: [heo, false]
    }
}

