class Solution {
    /**
     * Finds all occurrences of an integer x in a 2D list and returns their coordinates.
     * The coordinates are sorted first by rows in ascending order and then by columns in descending order.
     *
     * @param lst The 2D list to search through.
     * @param x The integer to find.
     * @return A list of lists containing the coordinates of x.
     */
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> result = new ArrayList<>();

        for (int i = 0; i < lst.size(); i++) {
            List<Integer> row = lst.get(i);
            for (int j = 0; j < row.size(); j++) {
                if (row.get(j) == x) {
                    result.add(Arrays.asList(i, j));
                }
            }
        }

        // Sort by row in ascending order and then by column in descending order
        result.sort((a, b) -> {
            if (!a.get(0).equals(b.get(0))) {
                return a.get(0) - b.get(0);
            } else {
                return b.get(1) - a.get(1);
            }
        });

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<List<Integer>> lst1 = Arrays.asList(
            Arrays.asList(1, 2, 3, 4, 5, 6),
            Arrays.asList(1, 2, 3, 4, 1, 6),
            Arrays.asList(1, 2, 3, 4, 5, 1)
        );
        int x1 = 1;
        System.out.println("Test Case 1: " + solution.get_row(lst1, x1));
        // Expected output: [[0, 0], [1, 4], [1, 0], [2, 5], [2, 0]]

        // Test case 2
        List<List<Integer>> lst2 = new ArrayList<>();
        int x2 = 1;
        System.out.println("Test Case 2: " + solution.get_row(lst2, x2));
