            new ArrayList<>(),
            Arrays.asList(1),
            Arrays.asList(1, 2, 3)
        );
        int x3 = 3;
        System.out.println("Test Case 3: " + solution.get_row(lst3, x3));
        // Expected output: [[2, 2]]
    }
}

