        System.out.println(solution.closest_integer("14.5"));    // Expected output: 15
        System.out.println(solution.closest_integer("-14.5"));   // Expected output: -15
        System.out.println(solution.closest_integer("14.1"));    // Expected output: 14
        System.out.println(solution.closest_integer("-14.1"));   // Expected output: -14
        System.out.println(solution.closest_integer("14.9"));    // Expected output: 15
