class Solution {
    /**
    The Fib4 number sequence is a sequence similar to the Fibonacci sequence that's defined as follows:
    fib4(0) -> 0
    fib4(1) -> 0
    fib4(2) -> 2
    fib4(3) -> 0
    fib4(n) -> fib4(n-1) + fib4(n-2) + fib4(n-3) + fib4(n-4).
    Please write a function to efficiently compute the n-th element of the fib4 number sequence.  Do not use recursion.
    >>> fib4(5)
    4
    >>> fib4(6)
    8
    >>> fib4(7)
    14
     */
    public int fib4(int n) {
        if (n == 0 || n == 1 || n == 3) return 0;
        if (n == 2) return 2;

        int[] dp = new int[n + 1];
        dp[0] = 0;
        dp[1] = 0;
        dp[2] = 2;
        dp[3] = 0;

        for (int i = 4; i <= n; i++) {
            dp[i] = dp[i - 1] + dp[i - 2] + dp[i - 3] + dp[i - 4];
        }

        return dp[n];
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.fib4(5)); // Expected output: 4
        System.out.println(solution.fib4(6)); // Expected output: 8
        System.out.println(solution.fib4(7)); // Expected output: 14
        System.out.println(solution.fib4(0)); // Expected output: 0
        System.out.println(solution.fib4(1)); // Expected output: 0
        System.out.println(solution.fib4(2)); // Expected output: 2
        System.out.println(solution.fib4(3)); // Expected output: 0
        System.out.println(solution.fib4(10)); // Expected output: 88
    }
}

