class Solution {
    /**
     * This function takes a string containing multiple groups of nested parentheses separated by spaces.
     * It returns a list of integers representing the deepest level of nesting for each group.
     * 
     * @param paren_string The input string containing groups of nested parentheses.
     * @return A list of integers representing the deepest level of nesting for each group.
     */
    public List<Integer> parse_nested_parens(String paren_string) {
        List<Integer> result = new ArrayList<>();
        String[] groups = paren_string.split(" ");

        for (String group : groups) {
            int maxDepth = 0;
            int currentDepth = 0;

            for (char c : group.toCharArray()) {
                if (c == '(') {
                    currentDepth++;
                    maxDepth = Math.max(maxDepth, currentDepth);
                } else if (c == ')') {
                    currentDepth--;
                }
            }

            result.add(maxDepth);
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        String testInput = "(()()) ((())) () ((())()())";
        List<Integer> result = solution.parse_nested_parens(testInput);

        System.out.println(result); // Expected output: [2, 3, 1, 3]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.parse_nested_parens("(()()) ((())) () ((())()())").equals(Arrays.asList(2, 3, 1, 3)),
                s.parse_nested_parens("() (()) ((())) (((())))").equals(Arrays.asList(1, 2, 3, 4)),
                s.parse_nested_parens("(()(())((())))").equals(Arrays.asList(4))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

