import java.util.Optional;

class Solution {
    /**
     * Given a string "text", return its md5 hash equivalent string with length being 32.
     * If "text" is an empty string, return Optional.empty().
     *
     * @param text The input string to convert to MD5 hash.
     * @return An Optional containing the MD5 hash of the input string, or Optional.empty() if the input is an empty string.
     * @throws NoSuchAlgorithmException If the MD5 algorithm is not available.
     */
    public Optional<String> string_to_md5(String text) throws NoSuchAlgorithmException {
        if (text.isEmpty()) {
            return Optional.empty();
        }

        MessageDigest md = MessageDigest.getInstance("MD5");
        byte[] messageDigest = md.digest(text.getBytes());
        BigInteger no = new BigInteger(1, messageDigest);
        String hashtext = no.toString(16);

        // Add leading zeros to make it 32 characters long
        while (hashtext.length() < 32) {
            hashtext = "0" + hashtext;
        }

        return Optional.of(hashtext);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        try {
            System.out.println("Test Case 1: 'Hello world'");
            Optional<String> result1 = solution.string_to_md5("Hello world");
            System.out.println("Expected: 3e25960a79dbc69b674cd4ec67a72c62");
            System.out.println("Actual: " + result1.orElse("N/A"));
            System.out.println();

            System.out.println("Test Case 2: '' (empty string)");
            Optional<String> result2 = solution.string_to_md5("");
            System.out.println("Expected: Optional.empty()");
            System.out.println("Actual: " + result2.orElse("N/A"));
            System.out.println();
        } catch (NoSuchAlgorithmException e) {
            e.printStackTrace();
        }
    }
}

public class Main {
    public static void main(String[] args) throws NoSuchAlgorithmException {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.string_to_md5("Hello world").get().equals("3e25960a79dbc69b674cd4ec67a72c62"),
                s.string_to_md5("").isEmpty(),
                s.string_to_md5("A B C").get().equals("0ef78513b0cb8cef12743f5aeb35f888"),
                s.string_to_md5("password").get().equals("5f4dcc3b5aa765d61d8327deb882cf99")
        );
