class Solution {
    /**
    Write a function count_nums which takes an array of integers and returns
    the number of elements which has a sum of digits > 0.
    If a number is negative, then its first signed digit will be negative:
    e.g. -123 has signed digits -1, 2, and 3.
    >>> count_nums(Arrays.asList()) == 0
    >>> count_nums(Arrays.asList(-1, 11, -11)) == 1
    >>> count_nums(Arrays.asList(1, 1, 2)) == 3
     */
    public int count_nums(List<Integer> arr) {
        // Helper method to calculate the sum of digits of a number
        int count = 0;
        for (int num : arr) {
            if (sumOfDigits(num) > 0) {
                count++;
            }
        }
        return count;
    }

    private int sumOfDigits(int n) {
        if (n >= 0) {
            int sum = 0;
            while (n != 0) {
                sum += n % 10;
                n /= 10;
            }
            return sum;
        } else {
            String numStr = String.valueOf(n);
            int sum = -Character.getNumericValue(numStr.charAt(1)); // First digit is negative
            for (int i = 2; i < numStr.length(); i++) {
                sum += Character.getNumericValue(numStr.charAt(i));
            }
            return sum;
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.count_nums(Arrays.asList())); // Expected output: 0
        System.out.println(solution.count_nums(Arrays.asList(-1, 11, -11))); // Expected output: 1
        System.out.println(solution.count_nums(Arrays.asList(1, 1, 2))); // Expected output: 3
    }
}

