class Solution {
    /**
    Given a positive integer n, return the product of the odd digits.
    Return 0 if all digits are even.
    For example:
    digits(1)  == 1
    digits(4)  == 0
    digits(235) == 15
     */
    public int digits(int n) {
        int product = 1;
        boolean hasOdd = false;

        while (n > 0) {
            int digit = n % 10;
            if (digit % 2 != 0) {
                product *= digit;
                hasOdd = true;
            }
            n /= 10;
        }

        return hasOdd ? product : 0;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.digits(1));    // Expected output: 1
        System.out.println(solution.digits(4));    // Expected output: 0
        System.out.println(solution.digits(235));  // Expected output: 15
        System.out.println(solution.digits(2468)); // Expected output: 0
        System.out.println(solution.digits(13579)); // Expected output: 945
    }
}

