class Solution {
    /**
     * From a supplied list of numbers (of length at least two) select and return two that are the closest to each
     * other and return them in order (smaller number, larger number).
     *
     * @param numbers List of Double values
     * @return A List containing the two closest numbers in ascending order
     */
    public List<Double> find_closest_elements(List<Double> numbers) {
        if (numbers == null || numbers.size() < 2) {
            throw new IllegalArgumentException("List must contain at least two elements.");
        }

        // Sort the list to make finding the closest pair easier
        Collections.sort(numbers);

        double minDiff = Double.MAX_VALUE;
        List<Double> closestPair = new ArrayList<>();

        for (int i = 0; i < numbers.size() - 1; i++) {
            double diff = numbers.get(i + 1) - numbers.get(i);
            if (diff < minDiff) {
                minDiff = diff;
                closestPair.clear();
                closestPair.add(numbers.get(i));
                closestPair.add(numbers.get(i + 1));
            }
        }

        return closestPair;
    }

    public static void main(String[] args) {
