class Solution {
    /**
     * Returns the 2nd smallest element of the list.
     * If there is no such element, returns Optional.empty().
     *
     * @param lst the list of integers
     * @return the 2nd smallest element or Optional.empty()
     */
    public Optional<Integer> next_smallest(List<Integer> lst) {
        // Remove duplicates and sort the list
        List<Integer> sortedList = lst.stream().distinct().sorted().collect(Collectors.toList());

        // Check if there are at least 2 unique elements
        if (sortedList.size() < 2) {
            return Optional.empty();
        }

        // Return the 2nd smallest element
        return Optional.of(sortedList.get(1));
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.next_smallest(Arrays.asList(1, 2, 3, 4, 5))); // Optional[2]
