class Solution {
    /**
    Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string.
    If shift > number of digits, return digits reversed.
    >>> circular_shift(12, 1)
    "21"
    >>> circular_shift(12, 2)
    "12"
     */
    public String circular_shift(int x, int shift) {
        // Convert the integer to a string
        String strX = Integer.toString(x);
        int n = strX.length();

        // If shift is greater than or equal to the number of digits, return the reversed string
        if (shift >= n) {
            return new StringBuilder(strX).reverse().toString();
        }

        // Ensure shift is within the bounds of the string length
        shift %= n;

        // Perform the circular shift
        String shifted = strX.substring(n - shift) + strX.substring(0, n - shift);

        // Return the result
        return shifted;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.circular_shift(12, 1)); // Output: "21"
        System.out.println(solution.circular_shift(12, 2)); // Output: "12"
    }
}

