class Solution {
    /**
     * Return 2^n modulo p (beaware of numerics).
     * 
     * @param n the exponent
     * @param p the modulus
     * @return 2^n % p
     */
    public int modp(int n, int p) {
        // Using modular exponentiation to avoid overflow
        int result = 1;
        int base = 2;

        while (n > 0) {
            if (n % 2 == 1) {
                result = (result * base) % p;
            }
            base = (base * base) % p;
            n = n / 2;
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.modp(3, 5));    // Expected output: 3
        System.out.println(solution.modp(1101, 101)); // Expected output: 2
        System.out.println(solution.modp(0, 101));   // Expected output: 1
        System.out.println(solution.modp(3, 11));    // Expected output: 8
        System.out.println(solution.modp(100, 101)); // Expected output: 1
    }
}

