class Solution {
    /**
     * Finds the strongest extension for a given class name and list of extensions.
     * The strength of an extension is calculated as the difference between the number
     * of uppercase letters (CAP) and the number of lowercase letters (SM) in its name.
     * If multiple extensions have the same strength, the first one in the list is chosen.
     *
     * @param class_name The name of the class.
     * @param extensions A list of extension names.
     * @return A string in the format "ClassName.Strongest_Extension".
     */
    public String Strongest_Extension(String class_name, List<String> extensions) {
        String strongestExtension = "";
        int maxStrength = Integer.MIN_VALUE;

        for (String extension : extensions) {
            int cap = 0;
            int sm = 0;
            for (char c : extension.toCharArray()) {
                if (Character.isUpperCase(c)) {
                    cap++;
                } else if (Character.isLowerCase(c)) {
                    sm++;
                }
            }
            int strength = cap - sm;
            if (strength > maxStrength) {
                maxStrength = strength;
                strongestExtension = extension;
            }
        }

        return class_name + "." + strongestExtension;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<String> extensions1 = Arrays.asList("SErviNGSliCes", "Cheese", "StuFfed");
        System.out.println(solution.Strongest_Extension("Slices", extensions1)); // Expected: Slices.SErviNGSliCes

        List<String> extensions2 = Arrays.asList("AA", "Be", "CC");
        System.out.println(solution.Strongest_Extension("my_class", extensions2)); // Expected: my_class.AA

        List<String> extensions3 = Arrays.asList("ABc", "DEF", "GhiJ");
        System.out.println(solution.Strongest_Extension("ExampleClass", extensions3)); // Expected: ExampleClass.DEF

        List<String> extensions4 = Arrays.asList("One", "Two", "Three");
        System.out.println(solution.Strongest_Extension("Test", extensions4)); // Expected: Test.One
    }
}

