class Solution {
    /**
     * Write a function that takes an array of numbers as input and returns
     * the number of elements in the array that are greater than 10 and both
     * first and last digits of a number are odd (1, 3, 5, 7, 9).
     * For example:
     * specialFilter(Arrays.asList(15, -73, 14, -15)) => 1
     * specialFilter(Arrays.asList(33, -2, -3, 45, 21, 109)) => 2
     */
    public int specialFilter(List<Integer> nums) {
        int count = 0;
        for (int num : nums) {
            if (num > 10 && isFirstAndLastDigitOdd(num)) {
                count++;
            }
        }
        return count;
    }

    private boolean isFirstAndLastDigitOdd(int num) {
        String numStr = String.valueOf(Math.abs(num));
        char firstDigit = numStr.charAt(0);
        char lastDigit = numStr.charAt(numStr.length() - 1);
        return isOdd(firstDigit) && isOdd(lastDigit);
    }

    private boolean isOdd(char digit) {
        return digit == '1' || digit == '3' || digit == '5' || digit == '7' || digit == '9';
    }

