class Solution {
    /**
     * Given an array of non-negative integers, return a copy of the given array after sorting,
     * you will sort the given array in ascending order if the sum( first index value, last index value) is odd,
     * or sort it in descending order if the sum( first index value, last index value) is even.
     *
     * @param array The input list of non-negative integers.
     * @return A new list sorted based on the specified conditions.
     */
    public List<Integer> sort_array(List<Integer> array) {
        if (array == null || array.isEmpty()) {
            return new ArrayList<>();
        }

        List<Integer> result = new ArrayList<>(array);
        int firstValue = array.get(0);
        int lastValue = array.get(array.size() - 1);
        int sum = firstValue + lastValue;

        if (sum % 2 == 0) {
            // Sort in descending order
            result.sort(Comparator.reverseOrder());
        } else {
            // Sort in ascending order
            result.sort(Comparator.naturalOrder());
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.sort_array(new ArrayList<>(List.of()))); // []
        System.out.println(solution.sort_array(new ArrayList<>(List.of(5)))); // [5]
        System.out.println(solution.sort_array(new ArrayList<>(List.of(2, 4, 3, 0, 1, 5)))); // [0, 1, 2, 3, 4, 5]
        System.out.println(solution.sort_array(new ArrayList<>(List.of(2, 4, 3, 0, 1, 5, 6)))); // [6, 5, 4, 3, 2, 1, 0]
    }
}

