    public boolean monotonic(List<Integer> l) {
        if (l == null || l.size() <= 1) {
            return true;
        }

        boolean increasing = true;
        boolean decreasing = true;

        for (int i = 1; i < l.size(); i++) {
            if (l.get(i) > l.get(i - 1)) {
                decreasing = false;
            }
            if (l.get(i) < l.get(i - 1)) {
                increasing = false;
            }
        }

        return increasing || decreasing;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Integer> test1 = Arrays.asList(1, 2, 4, 20);
        List<Integer> test2 = Arrays.asList(1, 20, 4, 10);
        List<Integer> test3 = Arrays.asList(4, 1, 0, -10);

        System.out.println("Test 1: " + solution.monotonic(test1)); // Expected: true
        System.out.println("Test 2: " + solution.monotonic(test2)); // Expected: false
        System.out.println("Test 3: " + solution.monotonic(test3)); // Expected: true
    }
}

