class Solution {
    /**
     * For a given list of input numbers, calculate Mean Absolute Deviation
     * around the mean of this dataset.
     * Mean Absolute Deviation is the average absolute difference between each
     * element and a centerpoint (mean in this case):
     * MAD = average | x - x_mean |
     *
     * @param numbers List of Double values
     * @return Mean Absolute Deviation
     */
    public double mean_absolute_deviation(List<Double> numbers) {
        if (numbers == null || numbers.isEmpty()) {
            throw new IllegalArgumentException("List must not be null or empty");
        }

        double sum = 0.0;
        for (double num : numbers) {
            sum += num;
        }
        double mean = sum / numbers.size();

        double madSum = 0.0;
        for (double num : numbers) {
            madSum += Math.abs(num - mean);
        }
        return madSum / numbers.size();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Double> test1 = Arrays.asList(1.0, 2.0, 3.0, 4.0);
        List<Double> test2 = Arrays.asList(5.0, 7.0, 9.0, 11.0);
        List<Double> test3 = Arrays.asList(1.5, 2.5, 3.5, 4.5);

        System.out.println("MAD of [1.0, 2.0, 3.0, 4.0]: " + solution.mean_absolute_deviation(test1)); // Expected: 1.0
        System.out.println("MAD of [5.0, 7.0, 9.0, 11.0]: " + solution.mean_absolute_deviation(test2)); // Expected: 2.0
        System.out.println("MAD of [1.5, 2.5, 3.5, 4.5]: " + solution.mean_absolute_deviation(test3)); // Expected: 1.0
    }
}

