class Solution {
    /**
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
     */
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 1; // Only one 1-digit number starts or ends with 1, which is 1 itself.
        } else {
            // For n > 1, there are 9^(n-1) numbers that start with 1 and 9^(n-1) numbers that end with 1.
            // However, we need to subtract the overlap (numbers that both start and end with 1) which is 9^(n-2).
            int startWithOne = (int) Math.pow(9, n - 1);
            int endWithOne = (int) Math.pow(9, n - 1);
            int bothStartAndEndWithOne = (int) Math.pow(9, n - 2);
            return 2 * startWithOne - bothStartAndEndWithOne;
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.starts_one_ends(1)); // Output: 1
        System.out.println(solution.starts_one_ends(2)); // Output: 17
        System.out.println(solution.starts_one_ends(3)); // Output: 162
    }
}

