class Solution {
    /**
    Write a function that returns true if the given number is the multiplication of 3 prime numbers
    and false otherwise.
    Knowing that the prime number is less than 100.
    Example:
    is_multiply_prime(30) == true
    30 = 2 * 3 * 5
     */
    public boolean is_multiply_prime(int a) {
        if (a < 2) return false;

        List<Integer> primes = generatePrimesLessThan100();
        int count = 0;

        for (int prime : primes) {
            while (a % prime == 0) {
                a /= prime;
                count++;
            }
            if (count > 3) break; // Early exit if more than 3 prime factors
        }

        return count == 3 && a == 1;
    }

    private List<Integer> generatePrimesLessThan100() {
        List<Integer> primes = new ArrayList<>();
        boolean[] isPrime = new boolean[100];
        Arrays.fill(isPrime, true);
        isPrime[0] = isPrime[1] = false;

        for (int i = 2; i < 100; i++) {
            if (isPrime[i]) {
                primes.add(i);
                for (int j = i * i; j < 100; j += i) {
                    isPrime[j] = false;
                }
            }
        }

        return primes;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.is_multiply_prime(30)); // true
        System.out.println(solution.is_multiply_prime(60)); // true
        System.out.println(solution.is_multiply_prime(100)); // false
        System.out.println(solution.is_multiply_prime(7)); // false
        System.out.println(solution.is_multiply_prime(210)); // true
        System.out.println(solution.is_multiply_prime(2)); // false
        System.out.println(solution.is_multiply_prime(1)); // false
        System.out.println(solution.is_multiply_prime(8)); // false
    }
}

