class Solution {
    /**
     * Finds the largest prime value in the list and returns the sum of its digits.
     *
     * @param lst The list of integers.
     * @return The sum of the digits of the largest prime number in the list.
     */
    public int skjkasdkd(List<Integer> lst) {
        int maxPrime = -1;

        // Find the largest prime number in the list
        for (int num : lst) {
            if (isPrime(num) && num > maxPrime) {
                maxPrime = num;
            }
        }

        // Calculate the sum of the digits of the largest prime number
        int sumOfDigits = 0;
        while (maxPrime > 0) {
            sumOfDigits += maxPrime % 10;
            maxPrime /= 10;
        }

        return sumOfDigits;
    }

    /**
     * Checks if a number is prime.
     *
     * @param num The number to check.
     * @return true if the number is prime, false otherwise.
     */
    private boolean isPrime(int num) {
        if (num <= 1) return false;
        if (num == 2) return true;
        if (num % 2 == 0) return false;
        for (int i = 3; i <= Math.sqrt(num); i += 2) {
            if (num % i == 0) return false;
        }
        return true;
    }

