class Solution {
    /**
    Write a function which sorts the given list of integers
    in ascending order according to the sum of their digits.
    Note: if there are several items with similar sum of their digits,
    order them based on their index in original list.
    If an integer is negative, then its first digit will be negative:
    e.g. -123 has digits -1, 2, and 3.

    For example:
    >>> order_by_points(Arrays.asList(1, 11, -1, -11, -12)) == [-1, -11, 1, -12, 11]
    >>> order_by_points(Arrays.asList()) == []
     */
    public List<Integer> order_by_points(List<Integer> nums) {
        // Helper method to calculate the sum of digits of an integer
        class DigitSumComparator implements Comparator<Integer> {
            @Override
            public int compare(Integer o1, Integer o2) {
                int sum1 = digitSum(o1);
                int sum2 = digitSum(o2);
                if (sum1 != sum2) {
                    return Integer.compare(sum1, sum2);
                } else {
                    return Integer.compare(nums.indexOf(o1), nums.indexOf(o2));
                }
            }

            private int digitSum(int n) {
                String numStr = String.valueOf(n);
                int sum = 0;
                if (numStr.charAt(0) == '-') {
                    sum -= Character.getNumericValue(numStr.charAt(1));
                    for (int i = 2; i < numStr.length(); i++) {
                        sum += Character.getNumericValue(numStr.charAt(i));
                    }
                } else {
                    for (int i = 0; i < numStr.length(); i++) {
                        sum += Character.getNumericValue(numStr.charAt(i));
                    }
                }
                return sum;
            }
        }

        // Sort the list using the custom comparator
        Collections.sort(nums, new DigitSumComparator());
        return nums;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> test1 = Arrays.asList(1, 11, -1, -11, -12);
        List<Integer> test2 = Arrays.asList();

        System.out.println(solution.order_by_points(test1)); // Output: [-1, -11, 1, -12, 11]
        System.out.println(solution.order_by_points(test2)); // Output: []
    }
}

