class Solution {
    /**
    In this Kata, you have to sort an array of integers according to
    number of ones in their binary representation in ascending order.
    For similar number of ones, sort based on decimal value.
    <p>
    It must be implemented like this:
    >>> sort_array(Arrays.asList(1, 5, 2, 3, 4)).equals(Arrays.asList(1, 2, 4, 3, 5))
    >>> sort_array(Arrays.asList(-2, -3, -4, -5, -6)).equals(Arrays.asList(-4, -2, -6, -5, -3))
    >>> sort_array(Arrays.asList(1, 0, 2, 3, 4)).equals(Arrays.asList(0, 1, 2, 4, 3))
     */
    public List<Integer> sort_array(List<Integer> arr) {
        // Helper method to count the number of ones in the binary representation of an integer
        class CountOnesComparator implements Comparator<Integer> {
            @Override
            public int compare(Integer o1, Integer o2) {
                int count1 = Integer.bitCount(o1);
                int count2 = Integer.bitCount(o2);
                if (count1 != count2) {
                    return count1 - count2;
                } else {
                    return o1 - o2;
                }
            }
        }

        // Sort the list using the custom comparator
        Collections.sort(arr, new CountOnesComparator());

        return arr;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.sort_array(Arrays.asList(1, 5, 2, 3, 4))); // [1, 2, 4, 3, 5]
        System.out.println(solution.sort_array(Arrays.asList(-2, -3, -4, -5, -6))); // [-4, -2, -6, -5, -3]
        System.out.println(solution.sort_array(Arrays.asList(1, 0, 2, 3, 4))); // [0, 1, 2, 4, 3]
    }
}

