class Solution {
    /**
    Validates a given date string and returns true if the date is valid otherwise false.
    The date is valid if all of the following rules are satisfied:
    1. The date string is not empty.
    2. The number of days is not less than 1 or higher than 31 days for months 1,3,5,7,8,10,12. 
       And the number of days is not less than 1 or higher than 30 days for months 4,6,9,11. 
       And, the number of days is not less than 1 or higher than 29 for the month 2.
    3. The months should not be less than 1 or higher than 12.
    4. The date should be in the format: mm-dd-yyyy
    */
    public boolean valid_date(String date) {
        // Check if the date string is empty
        if (date == null || date.isEmpty()) {
            return false;
        }

        // Split the date string by '-'
        String[] parts = date.split("-");
        if (parts.length != 3) {
            return false;
        }

        // Parse the month, day, and year
        int month, day, year;
        try {
            month = Integer.parseInt(parts[0]);
            day = Integer.parseInt(parts[1]);
            year = Integer.parseInt(parts[2]);
        } catch (NumberFormatException e) {
            return false;
        }

        // Validate the month
        if (month < 1 || month > 12) {
            return false;
        }

        // Validate the day based on the month
        if (day < 1 || day > 31) {
            return false;
        }
        if ((month == 4 || month == 6 || month == 9 || month == 11) && day > 30) {
            return false;
        }
        if (month == 2 && day > 29) {
            return false;
        }

        // If all checks pass, the date is valid
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.valid_date("03-11-2000")); // true
        System.out.println(solution.valid_date("15-01-2012")); // false
        System.out.println(solution.valid_date("04-0-2040"));  // false
        System.out.println(solution.valid_date("06-04-2020")); // true
        System.out.println(solution.valid_date("06/04/2020")); // false
        System.out.println(solution.valid_date("02-29-2020")); // true (leap year)
        System.out.println(solution.valid_date("02-29-2021")); // false (not a leap year)
    }
}

