class Solution {
    /**
    You are given a list of two strings, both strings consist of open
    parentheses "(" or close parentheses ")" only.
    Your job is to check if it is possible to concatenate the two strings in
    some order, that the resulting string will be good.
    A string S is considered to be good if and only if all parentheses in S
    are balanced. For example: the string "(())()" is good, while the string
    "())" is not.
    Return "Yes" if there's a way to make a good string, and return "No" otherwise.

    Examples:
    match_parens(Arrays.asList("()(", ")")) == "Yes"
    match_parens(Arrays.asList(")", ")")) == "No"
     */
    public String match_parens(List<String> lst) {
        // Check if concatenating in one order results in a balanced string
        if (isBalanced(lst.get(0) + lst.get(1))) {
            return "Yes";
        }
        // Check if concatenating in the reverse order results in a balanced string
        if (isBalanced(lst.get(1) + lst.get(0))) {
            return "Yes";
        }
        return "No";
    }

    private boolean isBalanced(String s) {
        int balance = 0;
        for (char c : s.toCharArray()) {
            if (c == '(') {
                balance++;
            } else if (c == ')') {
                balance--;
                if (balance < 0) {
                    return false; // Early exit if balance goes negative
                }
            }
        }
        return balance == 0;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<String> test1 = Arrays.asList("()(", ")");
        List<String> test2 = Arrays.asList(")", ")");
        List<String> test3 = Arrays.asList("(()", "())");
        List<String> test4 = Arrays.asList("(", ")");

        System.out.println(solution.match_parens(test1)); // Expected: "Yes"
        System.out.println(solution.match_parens(test2)); // Expected: "No"
        System.out.println(solution.match_parens(test3)); // Expected: "Yes"
        System.out.println(solution.match_parens(test4)); // Expected: "Yes"
    }
}

