class Solution {
    /**
    Write a function that takes a string and returns true if the string
    length is a prime number or false otherwise
    Examples
    prime_length("Hello") == true
    prime_length("abcdcba") == true
    prime_length("kittens") == true
    prime_length("orange") == false
     */
    public boolean prime_length(String string) {
        int length = string.length();
        return isPrime(length);
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n <= 3) {
            return true;
        }
        if (n % 2 == 0 || n % 3 == 0) {
            return false;
        }
        for (int i = 5; i * i <= n; i += 6) {
            if (n % i == 0 || n % (i + 2) == 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.prime_length("Hello"));    // true
        System.out.println(solution.prime_length("abcdcba"));  // true
        System.out.println(solution.prime_length("kittens"));   // true
        System.out.println(solution.prime_length("orange"));    // false
        System.out.println(solution.prime_length("a"));         // false
        System.out.println(solution.prime_length("ab"));        // true
        System.out.println(solution.prime_length("abc"));       // true
        System.out.println(solution.prime_length("abcd"));      // false
    }
}

