class Solution {
    /**
     * Encrypts a given string by rotating each letter in the alphabet by 4 places.
     * 
     * @param s The input string to be encrypted.
     * @return The encrypted string.
     */
    public String encrypt(String s) {
        StringBuilder encrypted = new StringBuilder();
        for (char c : s.toCharArray()) {
            if (Character.isLetter(c)) {
                char base = Character.isUpperCase(c) ? 'A' : 'a';
                char shifted = (char) ((c - base + 4) % 26 + base);
                encrypted.append(shifted);
            } else {
                encrypted.append(c);
            }
        }
        return encrypted.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.encrypt("hi")); // Should print "lm"
        System.out.println(solution.encrypt("asdfghjkl")); // Should print "ewhjklnop"
        System.out.println(solution.encrypt("gf")); // Should print "kj"
        System.out.println(solution.encrypt("et")); // Should print "ix"
        System.out.println(solution.encrypt("Hello, World!")); // Should print "Lipps, Asvph!"
    }
}

