class Solution {
    /**
     * For a given number n, find the largest number that divides n evenly, smaller than n.
     *
     * @param n the number to find the largest divisor for
     * @return the largest divisor of n that is smaller than n
     */
    public int largest_divisor(int n) {
        for (int i = n / 2; i >= 1; i--) {
            if (n % i == 0) {
                return i;
            }
        }
        return 1; // If no divisor is found, return 1 (every number is divisible by 1)
    }

    public static void main(String[] args) {
