class Solution {
    /**
     * Given a string s, if s[i] is a letter, reverse its case from lower to upper or vice versa,
     * otherwise keep it as it is. If the string contains no letters, reverse the string.
     * 
     * @param s the input string
     * @return the resulted string
     */
    public String solve(String s) {
        boolean hasLetters = false;
        StringBuilder result = new StringBuilder();

        for (char c : s.toCharArray()) {
            if (Character.isLetter(c)) {
                hasLetters = true;
                if (Character.isLowerCase(c)) {
                    result.append(Character.toUpperCase(c));
                } else {
                    result.append(Character.toLowerCase(c));
                }
            } else {
                result.append(c);
            }
        }

        if (!hasLetters) {
            result.reverse();
        }

        return result.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.solve("1234")); // Expected: "4321"
        System.out.println(solution.solve("ab"));   // Expected: "AB"
        System.out.println(solution.solve("#a@C")); // Expected: "#A@c"
    }
}

