class Solution {
    /**
     * Returns true if the object q will fly, and false otherwise.
     * The object q will fly if it's balanced (it is a palindromic list) and the sum of its elements is less than or equal to the maximum possible weight w.
     *
     * @param q the list of integers representing the object
     * @param w the maximum possible weight
     * @return true if the object will fly, false otherwise
     */
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is a palindrome
        for (int i = 0; i < q.size() / 2; i++) {
            if (!q.get(i).equals(q.get(q.size() - 1 - i))) {
                return false;
            }
        }

        // Calculate the sum of the elements
        int sum = 0;
        for (int num : q) {
            sum += num;
        }

        // Check if the sum is less than or equal to the maximum weight
        return sum <= w;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.will_it_fly(Arrays.asList(1, 2), 5)); // false
        System.out.println(solution.will_it_fly(Arrays.asList(3, 2, 3), 1)); // false
        System.out.println(solution.will_it_fly(Arrays.asList(3, 2, 3), 9)); // true
        System.out.println(solution.will_it_fly(Arrays.asList(3), 5)); // true
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
