        int end1 = interval1.get(1);
        int start2 = interval2.get(0);
        int end2 = interval2.get(1);

        // Calculate the intersection
        int startInter = Math.max(start1, start2);
        int endInter = Math.min(end1, end2);

        // Check if there is no intersection
        if (startInter > endInter) {
            return "NO";
        }

        // Calculate the length of the intersection
        int lengthInter = endInter - startInter + 1;

        // Check if the length is a prime number
        if (isPrime(lengthInter)) {
            return "YES";
        } else {
            return "NO";
        }
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n <= 3) {
            return true;
        }
        if (n % 2 == 0 || n % 3 == 0) {
            return false;
        }
        for (int i = 5; i * i <= n; i += 6) {
            if (n % i == 0 || n % (i + 2) == 0) {
                return false;
            }
        }
        return true;
    }
}

