class Solution {
    /**
     * Finds the greatest integer greater than zero whose frequency is greater than or equal to its value.
     * @param lst List of positive integers.
     * @return The greatest integer meeting the criteria, or -1 if no such integer exists.
     */
    public int search(List<Integer> lst) {
        Map<Integer, Integer> frequencyMap = new HashMap<>();

        // Count the frequency of each integer
        for (int num : lst) {
            frequencyMap.put(num, frequencyMap.getOrDefault(num, 0) + 1);
        }

        // Find the greatest integer that meets the criteria
        int result = -1;
        for (Map.Entry<Integer, Integer> entry : frequencyMap.entrySet()) {
            int num = entry.getKey();
            int freq = entry.getValue();
            if (num <= freq && num > result) {
                result = num;
            }
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Integer> test1 = Arrays.asList(4, 1, 2, 2, 3, 1);
