class Solution {
    /**
     * Encodes a string by shifting every character by 5 in the alphabet.
     * @param s The input string to be encoded.
     * @return The encoded string.
     */
    public String encodeShift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (Character.isLetter(ch)) {
                char base = Character.isUpperCase(ch) ? 'A' : 'a';
                sb.append((char) (base + ((ch - base + 5) % 26)));
            } else {
                sb.append(ch);
            }
        }
        return sb.toString();
    }

    /**
     * Decodes a string that was encoded using the encodeShift function.
     * @param s The encoded string to be decoded.
     * @return The decoded string.
     */
    public String decode_shift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (Character.isLetter(ch)) {
                char base = Character.isUpperCase(ch) ? 'A' : 'a';
                sb.append((char) (base + ((ch - base - 5 + 26) % 26)));
            } else {
                sb.append(ch);
            }
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        String original1 = "Hello, World!";
        String encoded1 = solution.encodeShift(original1);
        String decoded1 = solution.decode_shift(encoded1);

        System.out.println("Original: " + original1);
        System.out.println("Encoded: " + encoded1);
        System.out.println("Decoded: " + decoded1);

        String original2 = "Java Programming";
        String encoded2 = solution.encodeShift(original2);
        String decoded2 = solution.decode_shift(encoded2);

        System.out.println("Original: " + original2);
        System.out.println("Encoded: " + encoded2);
        System.out.println("Decoded: " + decoded2);
    }
}

