class Solution {
    /**
    Write a function that takes a message, and encodes in such a
    way that it swaps case of all letters, replaces all vowels in
    the message with the letter that appears 2 places ahead of that
    vowel in the english alphabet.
    Assume only letters.

    Examples:
    >>> encode("test")
    "TGST"
    >>> encode("This is a message")
    "tHKS KS C MGSSCGG"
     */
    public String encode(String message) {
        // Vowel mapping
        Map<Character, Character> vowelMap = new HashMap<>();
        vowelMap.put('a', 'c');
        vowelMap.put('e', 'g');
        vowelMap.put('i', 'k');
        vowelMap.put('o', 'q');
        vowelMap.put('u', 'w');
        vowelMap.put('A', 'C');
        vowelMap.put('E', 'G');
        vowelMap.put('I', 'K');
        vowelMap.put('O', 'Q');
        vowelMap.put('U', 'W');

        StringBuilder encodedMessage = new StringBuilder();

        for (char ch : message.toCharArray()) {
            if (Character.isLetter(ch)) {
                if (vowelMap.containsKey(ch)) {
                    // Replace vowel with the mapped character
                    encodedMessage.append(vowelMap.get(ch));
                } else {
                    // Swap case
                    if (Character.isLowerCase(ch)) {
                        encodedMessage.append(Character.toUpperCase(ch));
                    } else {
                        encodedMessage.append(Character.toLowerCase(ch));
                    }
                }
            } else {
                // Non-letter characters are appended as is
                encodedMessage.append(ch);
            }
        }

        return encodedMessage.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.encode("test"));  // Output: "TGST"
        System.out.println(solution.encode("This is a message"));  // Output: "tHKS KS C MGSSCGG"
    }
}

