class Solution {
    /**
     * Given a positive integer n, creates an integer array a of length n.
     * For each i (1 <= i <= n), the value of a[i] = i * i - i + 1.
     * Returns the number of triples (a[i], a[j], a[k]) of a where i < j < k,
     * and a[i] + a[j] + a[k] is a multiple of 3.
     *
     * @param n the length of the array
     * @return the number of valid triples
     */
    public int get_max_triples(int n) {
        int[] a = new int[n];
        for (int i = 1; i <= n; i++) {
            a[i - 1] = i * i - i + 1;
        }

        int count = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                for (int k = j + 1; k < n; k++) {
                    if ((a[i] + a[j] + a[k]) % 3 == 0) {
                        count++;
                    }
                }
            }
        }
        return count;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        int n1 = 5;
        System.out.println("Input: " + n1);
        System.out.println("Output: " + solution.get_max_triples(n1)); // Expected output: 1

        int n2 = 6;
        System.out.println("Input: " + n2);
        System.out.println("Output: " + solution.get_max_triples(n2)); // Expected output: 4

        int n3 = 7;
        System.out.println("Input: " + n3);
        System.out.println("Output: " + solution.get_max_triples(n3)); // Expected output: 10

        int n4 = 8;
        System.out.println("Input: " + n4);
        System.out.println("Output: " + solution.get_max_triples(n4)); // Expected output: 20
    }
}

