                Objects.equals(s.file_name_check("1example.dll" ), "No" ),
                Objects.equals(s.file_name_check("s1sdf3.asd" ), "No" ),
                Objects.equals(s.file_name_check("K.dll" ), "Yes" ),
                Objects.equals(s.file_name_check("MY16FILE3.exe" ), "Yes" ),
                Objects.equals(s.file_name_check("His12FILE94.exe" ), "No" ),
                Objects.equals(s.file_name_check("_Y.txt" ), "No" ),
                Objects.equals(s.file_name_check("?aREYA.exe" ), "No" ),
