class Solution {
    /**
    For a given string, flip lowercase characters to uppercase and uppercase to lowercase.
    >>> flip_case("Hello")
    "hELLO"
     */
    public String flip_case(String string) {
        StringBuilder result = new StringBuilder();
        for (char c : string.toCharArray()) {
            if (Character.isUpperCase(c)) {
                result.append(Character.toLowerCase(c));
            } else {
                result.append(Character.toUpperCase(c));
            }
        }
        return result.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.flip_case("Hello")); // Expected: "hELLO"
        System.out.println(solution.flip_case("Java"));  // Expected: "jAVA"
        System.out.println(solution.flip_case("1234"));  // Expected: "1234"
        System.out.println(solution.flip_case("AbCdEf")); // Expected: "aBcDeF"
        System.out.println(solution.flip_case(""));      // Expected: ""
    }
}

