class Solution {
    /**
     * Determines if it's possible to exchange elements between two lists to make the first list contain only even numbers.
     * @param lst1 The first list of integers.
     * @param lst2 The second list of integers.
     * @return "YES" if it's possible to make all elements in lst1 even by exchanging elements with lst2, otherwise "NO".
     */
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        // Count the number of odd numbers in lst1
        long oddCountLst1 = lst1.stream().filter(num -> num % 2 != 0).count();

        // Count the number of even numbers in lst2
        long evenCountLst2 = lst2.stream().filter(num -> num % 2 == 0).count();

        // If there are enough even numbers in lst2 to replace all odd numbers in lst1, return "YES"
        return evenCountLst2 >= oddCountLst1 ? "YES" : "NO";
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Integer> lst1_1 = Arrays.asList(1, 2, 3, 4);
        List<Integer> lst2_1 = Arrays.asList(1, 2, 3, 4);
        System.out.println(solution.exchange(lst1_1, lst2_1)); // Expected: "YES"

        List<Integer> lst1_2 = Arrays.asList(1, 2, 3, 4);
        List<Integer> lst2_2 = Arrays.asList(1, 5, 3, 4);
        System.out.println(solution.exchange(lst1_2, lst2_2)); // Expected: "NO"

        List<Integer> lst1_3 = Arrays.asList(2, 4, 6, 8);
        List<Integer> lst2_3 = Arrays.asList(1, 3, 5, 7);
        System.out.println(solution.exchange(lst1_3, lst2_3)); // Expected: "YES"

        List<Integer> lst1_4 = Arrays.asList(1, 3, 5, 7);
        List<Integer> lst2_4 = Arrays.asList(2, 4, 6, 8);
