        List<Integer> lst1_5 = Arrays.asList(1, 3, 5, 7);
        List<Integer> lst2_5 = Arrays.asList(1, 3, 5, 7);
        System.out.println(solution.exchange(lst1_5, lst2_5)); // Expected: "NO"
    }
}

