class Solution {
    /**
    Given a list of positive integers x. return a sorted list of all
    elements that hasn't any even digit.

    Note: Returned list should be sorted in increasing order.

    For example:
    >>> unique_digits(Arrays.asList(15, 33, 1422, 1))
    [1, 15, 33]
    >>> unique_digits(Arrays.asList(152, 323, 1422, 10))
    []
     */
    public List<Integer> unique_digits(List<Integer> x) {
        List<Integer> result = new ArrayList<>();

        for (Integer num : x) {
            if (hasNoEvenDigits(num)) {
                result.add(num);
            }
        }

        Collections.sort(result);
        return result;
    }

    private boolean hasNoEvenDigits(int num) {
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                return false;
            }
            num /= 10;
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<Integer> test1 = Arrays.asList(15, 33, 1422, 1);
        System.out.println("Test Case 1: " + solution.unique_digits(test1)); // Expected: [1, 15, 33]

        // Test case 2
        List<Integer> test2 = Arrays.asList(152, 323, 1422, 10);
        System.out.println("Test Case 2: " + solution.unique_digits(test2)); // Expected: []

        // Test case 3
        List<Integer> test3 = Arrays.asList(123, 456, 789, 135);
        System.out.println("Test Case 3: " + solution.unique_digits(test3)); // Expected: [135, 789]

        // Test case 4
        List<Integer> test4 = Arrays.asList(111, 222, 333, 444);
        System.out.println("Test Case 4: " + solution.unique_digits(test4)); // Expected: [111, 333]
