class Solution {
    /**
     * Plucks the node with the smallest even value from the array.
     * If multiple nodes have the same smallest even value, returns the one with the smallest index.
     * If no even values are found or the array is empty, returns an empty list.
     *
     * @param arr the list of non-negative integers representing the tree branch
     * @return a list containing the smallest even value and its index, or an empty list if no such value exists
     */
    public List<Integer> pluck(List<Integer> arr) {
        int minEvenValue = Integer.MAX_VALUE;
        int minIndex = -1;

        for (int i = 0; i < arr.size(); i++) {
            int value = arr.get(i);
            if (value % 2 == 0 && value < minEvenValue) {
                minEvenValue = value;
                minIndex = i;
            }
        }

        if (minIndex == -1) {
            return new ArrayList<>();
        } else {
            return Arrays.asList(minEvenValue, minIndex);
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Integer> test1 = Arrays.asList(4, 2, 3);
        List<Integer> test2 = Arrays.asList(1, 2, 3);
        List<Integer> test3 = new ArrayList<>();
        List<Integer> test4 = Arrays.asList(5, 0, 3, 0, 4, 2);

        System.out.println(solution.pluck(test1)); // Output: [2, 1]
        System.out.println(solution.pluck(test2)); // Output: [2, 1]
        System.out.println(solution.pluck(test3)); // Output: []
        System.out.println(solution.pluck(test4)); // Output: [0, 1]
    }
}

