class Solution {
    /**
     * Given an array arr of integers, returns the sum of magnitudes of integers
     * multiplied by the product of all signs of each number in the array, represented by 1, -1 or 0.
     * Note: return None for empty arr.
     *
     * @param arr List of integers
     * @return Optional<Integer> representing the result
     */
    public Optional<Integer> prod_signs(List<Integer> arr) {
        if (arr.isEmpty()) {
            return Optional.empty();
        }

        int signProduct = 1;
        int magnitudeSum = 0;

        for (int num : arr) {
            if (num == 0) {
                signProduct = 0;
                break;
            }
            signProduct *= (num > 0) ? 1 : -1;
            magnitudeSum += Math.abs(num);
        }

        return Optional.of(signProduct * magnitudeSum);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.prod_signs(Arrays.asList(1, 2, 2, -4))); // Expected: Optional[-9]
        System.out.println(solution.prod_signs(Arrays.asList(0, 1)));        // Expected: Optional[0]
        System.out.println(solution.prod_signs(Arrays.asList()));            // Expected: Optional.empty
        System.out.println(solution.prod_signs(Arrays.asList(-1, -2, -3)));  // Expected: Optional[6]
        System.out.println(solution.prod_signs(Arrays.asList(1, 1, 1, 1)));  // Expected: Optional[4]
    }
}

