class Solution {
    /**
     * Return n-th Fibonacci number.
     * 
     * @param n The position in the Fibonacci sequence.
     * @return The n-th Fibonacci number.
     */
    public int fib(int n) {
        if (n <= 1) {
            return n;
        }
        int a = 0, b = 1, c;
        for (int i = 2; i <= n; i++) {
            c = a + b;
            a = b;
            b = c;
        }
        return b;
    }

    public static void main(String[] args) {
