class Solution {
    /**
     * Accepts a list of strings, deletes the strings that have odd lengths,
     * and returns the resulted list with a sorted order.
     * The list is always a list of strings and never an array of numbers,
     * and it may contain duplicates.
     * The order of the list should be ascending by length of each word, and you
     * should return the list sorted by that rule.
     * If two words have the same length, sort the list alphabetically.
     * The function should return a list of strings in sorted order.
     * 
     * @param lst The list of strings to process.
     * @return A sorted list of strings with even lengths.
     */
    public List<String> sorted_list_sum(List<String> lst) {
        // Filter out strings with odd lengths
        List<String> filteredList = new ArrayList<>();
        for (String s : lst) {
            if (s.length() % 2 == 0) {
                filteredList.add(s);
            }
        }

        // Sort the list first by length, then alphabetically
        filteredList.sort((a, b) -> {
            if (a.length() != b.length()) {
                return a.length() - b.length();
            } else {
                return a.compareTo(b);
            }
        });

        return filteredList;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<String> test1 = Arrays.asList("aa", "a", "aaa");
        List<String> result1 = solution.sorted_list_sum(test1);
        System.out.println(result1); // Expected: ["aa"]

        List<String> test2 = Arrays.asList("ab", "a", "aaa", "cd");
        List<String> result2 = solution.sorted_list_sum(test2);
        System.out.println(result2); // Expected: ["ab", "cd"]

        List<String> test3 = Arrays.asList("hello", "world", "hi", "bye", "see");
        List<String> result3 = solution.sorted_list_sum(test3);
        System.out.println(result3); // Expected: ["hi", "see"]

        List<String> test4 = Arrays.asList("one", "two", "three", "four", "five");
        List<String> result4 = solution.sorted_list_sum(test4);
        System.out.println(result4); // Expected: ["two", "four"]
    }
}

