    rounded_avg(20, 33) => "11011"
     */
    public Object rounded_avg(int n, int m) {
        if (n > m) {
            return -1;
        }

        int sum = 0;
        for (int i = n; i <= m; i++) {
            sum += i;
        }

        int count = m - n + 1;
        int average = Math.round((float) sum / count);
        return Integer.toBinaryString(average);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.rounded_avg(1, 5));   // Expected output: "11"
        System.out.println(solution.rounded_avg(7, 5));   // Expected output: -1
        System.out.println(solution.rounded_avg(10, 20)); // Expected output: "1111"
        System.out.println(solution.rounded_avg(20, 33)); // Expected output: "11011"
    }
}

