class Solution {
    /**
     * Given a positive integer n, you have to make a pile of n levels of stones.
     * The first level has n stones.
     * The number of stones in the next level is:
     * - the next odd number if n is odd.
     * - the next even number if n is even.
     * Return the number of stones in each level in a list, where element at index
     * i represents the number of stones in the level (i+1).
     *
     * Examples:
     * >>> make_a_pile(3)
     * [3, 5, 7]
     */
    public List<Integer> make_a_pile(int n) {
        List<Integer> result = new ArrayList<>();
        int current = n;
        for (int i = 0; i < n; i++) {
            result.add(current);
            if (current % 2 == 0) {
                current += 2; // next even number
            } else {
                current += 2; // next odd number
            }
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.make_a_pile(3)); // Expected: [3, 5, 7]
        System.out.println(solution.make_a_pile(4)); // Expected: [4, 6, 8, 10]
        System.out.println(solution.make_a_pile(1)); // Expected: [1]
        System.out.println(solution.make_a_pile(5)); // Expected: [5, 7, 9, 11, 13]
    }
}

