class Solution {
    /**
    You'll be given a string of words, and your task is to count the number
    of boredoms. A boredom is a sentence that starts with the word "I".
    Sentences are delimited by '.', '?' or '!'.

    For example:
    >>> is_bored("Hello world")
    0
    >>> is_bored("The sky is blue. The sun is shining. I love this weather")
    1
     */
    public int is_bored(String S) {
        // Split the input string into sentences using regex for '.', '?' or '!'
        String[] sentences = S.split("[.?!]");

        int boredomCount = 0;

        // Iterate through each sentence
        for (String sentence : sentences) {
            // Trim leading and trailing whitespace
            String trimmedSentence = sentence.trim();

            // Check if the sentence starts with "I"
            if (trimmedSentence.startsWith("I ")) {
                boredomCount++;
            }
        }

        return boredomCount;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.is_bored("Hello world")); // Expected output: 0
        System.out.println(solution.is_bored("The sky is blue. The sun is shining. I love this weather")); // Expected output: 1
        System.out.println(solution.is_bored("I am bored. I really am. What about you?")); // Expected output: 2
        System.out.println(solution.is_bored("It's a beautiful day. I think I'll go for a walk.")); // Expected output: 1
        System.out.println(solution.is_bored("No sentences starting with I here.")); // Expected output: 0
    }
}

