class Solution {
    /**
    Input are two strings a and b consisting only of 1s and 0s.
    Perform binary XOR on these inputs and return result also as a string.
    >>> string_xor("010", "110")
    "100"
     */
    public String string_xor(String a, String b) {
        StringBuilder result = new StringBuilder();

        // Ensure both strings are of the same length
        int maxLength = Math.max(a.length(), b.length());
        a = String.format("%" + maxLength + "s", a).replace(' ', '0');
        b = String.format("%" + maxLength + "s", b).replace(' ', '0');

        for (int i = 0; i < maxLength; i++) {
            // XOR the current bits
            char bitA = a.charAt(i);
            char bitB = b.charAt(i);
            char xorResult = (bitA == bitB) ? '0' : '1';
            result.append(xorResult);
        }

        return result.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.string_xor("010", "110")); // Expected: "100"
        System.out.println(solution.string_xor("10101", "00111")); // Expected: "10010"
        System.out.println(solution.string_xor("1111", "0000")); // Expected: "1111"
        System.out.println(solution.string_xor("1", "1")); // Expected: "0"
        System.out.println(solution.string_xor("0", "0")); // Expected: "0"
        System.out.println(solution.string_xor("10101010", "11110000")); // Expected: "01011010"
    }
}

