class Solution {
    /**
     * Given a string s and a natural number n, this function returns a list of all words from string s that contain exactly
     * n consonants, in the order these words appear in the string s.
     * If the string s is empty then the function should return an empty list.
     * Note: you may assume the input string contains only letters and spaces.
     * 
     * @param s The input string.
     * @param n The number of consonants each word must contain.
     * @return A list of words containing exactly n consonants.
     */
    public List<String> select_words(String s, int n) {
        if (s == null || s.isEmpty()) {
            return new ArrayList<>();
        }

        String[] words = s.split("\\s+");
        List<String> result = new ArrayList<>();

        for (String word : words) {
            if (countConsonants(word) == n) {
                result.add(word);
            }
        }

        return result;
    }

    private int countConsonants(String word) {
        int count = 0;
        for (char c : word.toCharArray()) {
            if (isConsonant(c)) {
                count++;
            }
        }
        return count;
    }

    private boolean isConsonant(char c) {
        return !isVowel(c) && Character.isLetter(c);
    }

    private boolean isVowel(char c) {
        return "AEIOUaeiou".indexOf(c) != -1;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.select_words("Mary had a little lamb", 4)); // ["little"]
        System.out.println(solution.select_words("Mary had a little lamb", 3)); // ["Mary", "lamb"]
        System.out.println(solution.select_words("simple white space", 2));     // []
        System.out.println(solution.select_words("Hello world", 4));            // ["world"]
        System.out.println(solution.select_words("Uncle sam", 3));              // ["Uncle"]
        System.out.println(solution.select_words("", 3));                       // []
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.select_words("Mary had a little lamb", 4).equals(List.of("little" )),
                s.select_words("Mary had a little lamb", 3).equals(Arrays.asList("Mary", "lamb")),
                s.select_words("simple white space", 2).equals(List.of()),
                s.select_words("Hello world", 4).equals(List.of("world" )),
                s.select_words("Uncle sam", 3).equals(List.of("Uncle" )),
                s.select_words("", 4).equals(List.of()),
                s.select_words("a b c d e f", 1).equals(Arrays.asList("b", "c", "d", "f"))
        );
