class Solution {
    /**
     * prime_fib returns the n-th number that is both a Fibonacci number and a prime number.
     * 
     * @param n The position of the number in the sequence of prime Fibonacci numbers.
     * @return The n-th prime Fibonacci number.
     */
    public int prime_fib(int n) {
        int count = 0;
        int fib1 = 0;
        int fib2 = 1;
        while (true) {
            int nextFib = fib1 + fib2;
            if (isPrime(nextFib)) {
                count++;
                if (count == n) {
                    return nextFib;
                }
            }
            fib1 = fib2;
            fib2 = nextFib;
        }
    }

    /**
     * isPrime checks if a number is prime.
     * 
     * @param num The number to check.
     * @return true if the number is prime, false otherwise.
     */
    private boolean isPrime(int num) {
        if (num <= 1) return false;
        if (num <= 3) return true;
        if (num % 2 == 0 || num % 3 == 0) return false;
        for (int i = 5; i * i <= num; i += 6) {
            if (num % i == 0 || num % (i + 2) == 0) return false;
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.prime_fib(1)); // Expected output: 2
        System.out.println(solution.prime_fib(2)); // Expected output: 3
        System.out.println(solution.prime_fib(3)); // Expected output: 5
        System.out.println(solution.prime_fib(4)); // Expected output: 13
        System.out.println(solution.prime_fib(5)); // Expected output: 89
    }
}

