class Solution {
    /**
    Return true if a given number is prime, and false otherwise.
    >>> is_prime(6)
    false
    >>> is_prime(101)
    true
    >>> is_prime(11)
    true
    >>> is_prime(13441)
    true
    >>> is_prime(61)
    true
    >>> is_prime(4)
    false
    >>> is_prime(1)
    false
     */
    public boolean is_prime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n == 2) {
            return true;
        }
        if (n % 2 == 0) {
            return false;
        }
        for (int i = 3; i * i <= n; i += 2) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.is_prime(6));      // Expected: false
        System.out.println(solution.is_prime(101));    // Expected: true
        System.out.println(solution.is_prime(11));     // Expected: true
        System.out.println(solution.is_prime(13441));  // Expected: true
        System.out.println(solution.is_prime(61));     // Expected: true
        System.out.println(solution.is_prime(4));      // Expected: false
        System.out.println(solution.is_prime(1));      // Expected: false
    }
}

