class Solution {
    /**
    Implement the function f that takes n as a parameter,
    and returns a list of size n, such that the value of the element at index i is the factorial of i if i is even
    or the sum of numbers from 1 to i otherwise.
    i starts from 1.
    the factorial of i is the multiplication of the numbers from 1 to i (1 * 2 * ... * i).
    Example:
    f(5) == [1, 2, 6, 24, 15]
     */
    public List<Integer> f(int n) {
        List<Integer> result = new ArrayList<>();
        for (int i = 1; i <= n; i++) {
            if (i % 2 == 0) {
                result.add(factorial(i));
            } else {
                result.add(sumTo(i));
            }
        }
        return result;
    }

    private int factorial(int num) {
        int result = 1;
        for (int i = 1; i <= num; i++) {
            result *= i;
        }
        return result;
    }

    private int sumTo(int num) {
        return (num * (num + 1)) / 2;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        int n = 5;
        List<Integer> result = solution.f(n);
        System.out.println("Result: " + result);
        // Expected output: [1, 2, 6, 24, 15]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.f(5).equals(Arrays.asList(1, 2, 6, 24, 15)),
                s.f(7).equals(Arrays.asList(1, 2, 6, 24, 15, 720, 28)),
                s.f(1).equals(List.of(1)),
                s.f(3).equals(Arrays.asList(1, 2, 6))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

