class Solution {
    /**
    The Brazilian factorial is defined as:
    brazilian_factorial(n) = n! * (n-1)! * (n-2)! * ... * 1!
    where n > 0

    For example:
    >>> special_factorial(4)
    288

    The function will receive an integer as input and should return the special
    factorial of this integer.
     */
    public long special_factorial(int n) {
        long result = 1;
        for (int i = 1; i <= n; i++) {
            result *= factorial(i);
        }
        return result;
    }

    private long factorial(int k) {
        long fact = 1;
        for (int i = 1; i <= k; i++) {
            fact *= i;
        }
        return fact;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println("Special Factorial of 4: " + solution.special_factorial(4)); // Expected: 288
