class Solution {
    private static final String[] DIGIT_NAMES = {"One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"};

    /**
     * Sorts the integers between 1 and 9, reverses the sorted array, and replaces each digit by its corresponding name.
     *
     * @param arr The input list of integers.
     * @return A list of strings representing the names of the digits.
     */
    public List<String> by_length(List<Integer> arr) {
        // Filter out numbers not in the range 1-9
        List<Integer> filteredList = arr.stream()
                                        .filter(num -> num >= 1 && num <= 9)
                                        .sorted()
                                        .collect(Collectors.toList());

        // Reverse the sorted list
        Collections.reverse(filteredList);

        // Replace each digit by its corresponding name
        List<String> result = new ArrayList<>();
        for (int num : filteredList) {
            result.add(DIGIT_NAMES[num - 1]);
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<Integer> arr1 = Arrays.asList(2, 1, 1, 4, 5, 8, 2, 3);
        System.out.println(solution.by_length(arr1)); // Expected: ["Eight", "Five", "Four", "Three", "Two", "Two", "One", "One"]

        // Test case 2
        List<Integer> arr2 = new ArrayList<>();
        System.out.println(solution.by_length(arr2)); // Expected: []

        // Test case 3
        List<Integer> arr3 = Arrays.asList(1, -1, 55);
        System.out.println(solution.by_length(arr3)); // Expected: ["One"]
    }
}

