        // Test case 3: List with varying lengths
        System.out.println("Test case 3: " + solution.longest(Arrays.asList("a", "bb", "ccc"))); // Expected: Optional[ccc]

        // Test case 4: List with multiple longest strings
        System.out.println("Test case 4: " + solution.longest(Arrays.asList("aaa", "bbb", "ccc"))); // Expected: Optional[aaa]

        // Test case 5: List with one string
        System.out.println("Test case 5: " + solution.longest(Arrays.asList("single"))); // Expected: Optional[single]
    }
}

