class Solution {
    /**
     * Evaluate whether the given number n can be written as the sum of exactly 4 positive even numbers.
     * 
     * @param n The number to evaluate.
     * @return true if n can be written as the sum of exactly 4 positive even numbers, false otherwise.
     */
    public boolean is_equal_to_sum_even(int n) {
        // The smallest sum of 4 positive even numbers is 2 + 2 + 2 + 2 = 8
        // Any number less than 8 cannot be written as the sum of 4 positive even numbers
        if (n < 8) {
            return false;
        }

        // If n is even and greater than or equal to 8, it can always be written as the sum of 4 even numbers
        return n % 2 == 0;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        int[] testNumbers = {4, 6, 8, 10, 12, 14, 16};

        for (int num : testNumbers) {
            System.out.println("is_equal_to_sum_even(" + num + ") == " + solution.is_equal_to_sum_even(num));
        }
    }
}

