     */
    public int car_race_collision(int n) {
        // Each car going left to right will eventually collide with each car going right to left.
        // Therefore, the total number of collisions is n * n.
        return n * n;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        int[] testCases = {0, 1, 2, 5, 10};

        for (int n : testCases) {
            int collisions = solution.car_race_collision(n);
            System.out.println("Number of collisions for " + n + " cars: " + collisions);
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.car_race_collision(2) == 4,
                s.car_race_collision(3) == 9,
                s.car_race_collision(4) == 16,
                s.car_race_collision(8) == 64,
                s.car_race_collision(10) == 100
        );
