class Solution {
    /**
     * Calculates the number of mangoes in the basket based on the given string and total number of fruits.
     * 
     * @param s The string representing the number of apples and oranges.
     * @param n The total number of fruits in the basket.
     * @return The number of mangoes in the basket.
     */
    public int fruit_distribution(String s, int n) {
        // Split the input string to extract the numbers
        String[] parts = s.split(" ");
        int apples = Integer.parseInt(parts[0]);
        int oranges = Integer.parseInt(parts[3]);

        // Calculate the number of mangoes
        int mangoes = n - (apples + oranges);
        return mangoes;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.fruit_distribution("5 apples and 6 oranges", 19)); // Expected output: 8
