class Solution {
    /**
    This function takes a list l and returns a list l' such that
    l' is identical to l in the indicies that are not divisible by three, while its values at the indicies that are divisible by three are equal
    to the values of the corresponding indicies of l, but sorted in ascending order.
    >>> sort_third(Arrays.asList(1, 2, 3))
    [1, 2, 3]
    >>> sort_third(Arrays.asList(5, 6, 3, 4, 8, 9, 2))
    [2, 6, 3, 4, 8, 9, 5]
     */
    public List<Integer> sort_third(List<Integer> l) {
        // Extract elements at indices divisible by 3
        List<Integer> divisibleByThree = new ArrayList<>();
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                divisibleByThree.add(l.get(i));
            }
        }

        // Sort the extracted elements
        Collections.sort(divisibleByThree);

        // Create a new list with the sorted elements placed back at the correct positions
        List<Integer> result = new ArrayList<>(l);
        for (int i = 0, j = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                result.set(i, divisibleByThree.get(j++));
            }
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sort_third(new ArrayList<>(Arrays.asList(5, 6, 3, 4, 8, 9, 2))).equals(Arrays.asList(2, 6, 3, 4, 8, 9, 5)),
                s.sort_third(new ArrayList<>(Arrays.asList(5, 8, 3, 4, 6, 9, 2))).equals(Arrays.asList(2, 8, 3, 4, 6, 9, 5)),
                s.sort_third(new ArrayList<>(Arrays.asList(5, 6, 9, 4, 8, 3, 2))).equals(Arrays.asList(2, 6, 9, 4, 8, 3, 5)),
                s.sort_third(new ArrayList<>(Arrays.asList(5, 6, 3, 4, 8, 9, 2, 1))).equals(Arrays.asList(2, 6, 3, 4, 8, 9, 5, 1))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

