class Solution {
    /**
     * Create a function that returns a tuple (a, b), where 'a' is
     * the largest of negative integers, and 'b' is the smallest
     * of positive integers in a list.
     * If there is no negative or positive integers, return them as None.
     *
     * Examples:
     * largest_smallest_integers(Arrays.asList(2, 4, 1, 3, 5, 7)) == (Optional.empty(), Optional.of(1))
     * largest_smallest_integers(Arrays.asList()) == (Optional.empty(), Optional.empty())
     * largest_smallest_integers(Arrays.asList(0)) == (Optional.empty(), Optional.empty())
     */
    public List<Optional<Integer>> largest_smallest_integers(List<Integer> lst) {
        Optional<Integer> largestNegative = lst.stream()
                .filter(n -> n < 0)
                .max(Integer::compare);

        Optional<Integer> smallestPositive = lst.stream()
                .filter(n -> n > 0)
                .min(Integer::compare);

        return Arrays.asList(largestNegative, smallestPositive);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        List<Integer> test1 = Arrays.asList(2, 4, 1, 3, 5, 7);
        List<Integer> test2 = Arrays.asList();
        List<Integer> test3 = Arrays.asList(0);
        List<Integer> test4 = Arrays.asList(-1, -3, -5, -2, 2, 4, 1, 3, 5, 7);

        // Expected: (Optional.empty(), Optional.of(1))
        System.out.println(solution.largest_smallest_integers(test1));

        // Expected: (Optional.empty(), Optional.empty())
        System.out.println(solution.largest_smallest_integers(test2));

        // Expected: (Optional.empty(), Optional.empty())
        System.out.println(solution.largest_smallest_integers(test3));

        // Expected: (Optional.of(-1), Optional.of(1))
        System.out.println(solution.largest_smallest_integers(test4));
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.largest_smallest_integers(Arrays.asList(2, 4, 1, 3, 5, 7)).equals(Arrays.asList(Optional.empty(), Optional.of(1))),
                s.largest_smallest_integers(Arrays.asList(2, 4, 1, 3, 5, 7, 0)).equals(Arrays.asList(Optional.empty(), Optional.of(1))),
                s.largest_smallest_integers(Arrays.asList(1, 3, 2, 4, 5, 6, -2)).equals(Arrays.asList(Optional.of(-2), Optional.of(1))),
                s.largest_smallest_integers(Arrays.asList(4, 5, 3, 6, 2, 7, -7)).equals(Arrays.asList(Optional.of(-7), Optional.of(2))),
                s.largest_smallest_integers(Arrays.asList(7, 3, 8, 4, 9, 2, 5, -9)).equals(Arrays.asList(Optional.of(-9), Optional.of(2))),
                s.largest_smallest_integers(List.of()).equals(Arrays.asList(Optional.empty(), Optional.empty())),
                s.largest_smallest_integers(List.of(0)).equals(Arrays.asList(Optional.empty(), Optional.empty())),
                s.largest_smallest_integers(Arrays.asList(-1, -3, -5, -6)).equals(Arrays.asList(Optional.of(-1), Optional.empty())),
                s.largest_smallest_integers(Arrays.asList(-1, -3, -5, -6, 0)).equals(Arrays.asList(Optional.of(-1), Optional.empty())),
